Should we instead provide this in a structured way? 

  struct
  {
    string priid<MAX_STRING_SIZE_OF_PRIID>;
    string fwver<MAX_STRING_OF_FW_VER>;
  } swi_dms_auto_sim_configuration_type; 

This way it is self explanatory and caller does not need to do any string processing to extract PRIID or FW Version. Can refer to the Image switching code to determine what max string of PRIID and FW version are.

By referring to the generated *.h file, coding still looks straightforward for accessing a separate field:

For example: 

swi_dms_get_auto_sim_list_resp_msg_v01 *resp = ...;

assert (resp->attribs_len == resp->source_len)

for (i = 0; i < resp->attribs_len; i++)
{
  display (resp->attribs[i]);
  display (resp->source[i]);
}

At least for me, I prefer this way...

Please add

//! comment before each field

Please also add a new line between each field.

